export const addSlot = (slot, babysitterId) => {

return (dispatch) => {
    fetch(`http://localhost3000/api/v1/babysitters/${babysitterId}/slots`, {
        method: 'POST',
        headers: {
            'Content-Type': 'application/json'
        }
    })
}

}
